    //弹出下载按钮
    showDownload() {
        this.open_door.visible = 1
        this.door.visible = 0
        setTimeout(() => {
            var rect = new Phaser.Geom.Rectangle(0, 0, game.config.width, game.config.height);
            var graphics = this.add.graphics({
                fillStyle: {
                    color: 0x000000
                }
            });
            graphics.alpha = 0.9;
            graphics.setDepth(8);
            graphics.fillRectShape(rect);
            var winPanel1 = this.add.sprite(game.config.width / 2, game.config.height / 2, "boom").setOrigin(0.5, 0.5);
            // winPanel1.visible = 0
            winPanel1.setDepth(10);
            var winPanel = this.add.sprite(game.config.width / 2, game.config.height / 2, "box").setInteractive();
            winPanel.scaleX = 0
            winPanel.scaleY = 0
            winPanel.setDepth(10);

            // show panel
            this.tweens.add({
                targets: [winPanel],
                // y: game.config.height / 2,
                scaleX: 1,
                scaleY: 1,
                duration: 500,
                // ease: 'Back',
                callbackScope: this,
                onComplete: function (tween) {
                    setInterval(() => {
                        winPanel1.rotation += 1
                    }, 80);
                    setTimeout(() => {
                        this.tweens.add({
                            targets: [winPanel],
                            // y: game.config.height / 2,
                            scaleX: 0.8,
                            scaleY: 0.8,
                            duration: 200,
                        })
                    }, 100);


                    setInterval(() => {
                        winPanel1.rotation += 1
                    }, 100);

                    winPanel.on('pointerdown', function (pointer) {
                        landingPage();
                    }, this);

                }
            });
        }, 500);
    }

    resize() {
        var canvas = document.querySelector("canvas");
        var windowWidth = window.innerWidth;
        var windowHeight = window.innerHeight;
        var windowRatio = windowWidth / windowHeight;
        var gameRatio = game.config.width / game.config.height;
        if (windowRatio < gameRatio) {
            canvas.style.width = windowWidth + "px";
            canvas.style.height = (windowWidth / gameRatio) + "px";
        } else {
            canvas.style.width = (windowHeight * gameRatio) + "px";
            canvas.style.height = windowHeight + "px";
        }
    }
